import React, { useState, useEffect, setState } from 'react';
import { init, AuthType } from "@thoughtspot/visual-embed-sdk";
import { SearchEmbed, LiveboardEmbed, AppEmbed, useEmbedRef } from '@thoughtspot/visual-embed-sdk/react';

function IQVIA() {
    const [tsVisible, setTsVisible] = useState('')


    useEffect(() => {
        init({
            thoughtSpotHost: 'https://se-thoughtspot-cloud.thoughtspot.cloud/#',
            authType: AuthType.None,
        });
        setTsVisible(false);
    }, [])


    //                    <SearchEmbed frameParams={{width:'100%',height:'100vh'}} />

    return(
        <div style={{display:"flex"}}>
            <div style={{flex:1,height:'100%',width:'100%',display:"flex",flexDirection:'column'}}>

                <div style={{flex:1, minHeight:'40px',maxHeight:'40px',display:"flex",flexDirection:'row', background:'#abcabc'}} >
                    Nice
                </div>
                <div style={{height:'100%',width:'100%',display:"flex",flexDirection:'row'}} >
                    <div style={{flex:1,maxWidth:'250px',display:"flex",flexDirection:'column',background:'#ecefdd'}}>
                        this Dashboard
                    </div>                
                    <div style={{height:'100vh', display:"flex",flexDirection:'column',flex:1, background:'#f6f7fd'}}>
                        <div>
                        <div className="hoverer" style={{position:'absolute',marginTop:'calc(10% + 40px)',marginLeft:'20%',width:'300px',height:'5%',background:'#cccccc'}}>Click Me!</div>
                        <div className="hoverer" style={{position:'absolute',marginTop:'calc(15% + 40px)',marginLeft:'20%',width:'300px',height:'5%',background:'#cccccc'}}>Click Me!</div>
                        <div className="hoverer" style={{position:'absolute',marginTop:'calc(20% + 40px)',marginLeft:'20%',width:'300px',height:'5%',background:'#cccccc'}}>Click Me!</div>
                        <div className="hoverer" style={{position:'absolute',marginTop:'calc(25% + 40px)',marginLeft:'20%',width:'300px',height:'5%',background:'#cccccc'}}>Click Me!</div>
                        <img src="apollo.png" width='100%'/>

                        </div>
                        <div>
                        OtherStuffDown Here

                        </div>
                    </div>
                </div>
            </div>
            {
                tsVisible ? 
                <div style={{position:'absolute', width:'70%', height:'70%'}}>
                </div>
                : <div></div>
            }

        </div>
    )
}
export default IQVIA;
